        private  int[,] savePoint =new int[4, 2] { { 0, 0 },{ 0, 0 },{ 0, 0 } ,{ 0, 0 }};
        private double SplitX, SplitY;
        private int _level = 0;
        internal void SetLevel(int level)
        {
            _level = level; 
            SplitY = (SystemParameters.PrimaryScreenHeight * 0.925) / 100;
            SplitX = (SystemParameters.PrimaryScreenWidth * 0.519) / 100;
        }
        internal int IsBullInLegalZone(double Y,double X,int player)
        {
            X= X<0 ||X/ SplitX > 100.0 ? 0:X+2.0;
            Y= Y<0|| Y/ SplitY >100.0? 0:Y + 2.0;
            if (Y / SplitY > 45.0 && Y / SplitY < 55.0&& X / SplitX>44.0 && X / SplitX<55.0)
                return 2;
            if (Bord[_level, (int)((Y) / SplitY), (int)((X) / SplitX)] == 1)
                return 1;
            else if (Bord[_level, (int)((Y) / SplitY), (int)((X) / SplitX)] != 0)
            {
                int tY = (int)((Y) / SplitY);
                int tX = (int)((X) / SplitX);
                int v = Bord[_level, tY, tX];
                while (v != 6)
                {
                    switch (v)
                    {
                        case 2: tY--; break;
                        case 3: tY++; break;
                        case 4: tX--; break;
                        case 5: tX++; break;
                        default:
                            break;
                    }
                    v = Bord[_level, tY, tX];
                }
                savePoint[player, 0] = tY;
                savePoint[player, 1] = tX;
            }
            return 0;
        }
        internal double[] GetSavePoint(int player)
        {
            return new double[] { savePoint[player, 0]* SplitY, savePoint[player, 1]* SplitX };
        }
        internal void Reset(int player)
        {
            savePoint[player, 0] = savePoint[player, 1] = 0;
        }
    }
